import 'package:google_maps_flutter/google_maps_flutter.dart';

import '../domain/alert.dart';
import '../domain/route.dart';

class MockObjects {

  static List<Alert> createManyAlert(int howMany) {
    List<Alert> alerts = [];
    for (int i = 0; i < howMany; i++) {
      alerts.add(createAlert(i));
    }
    return alerts;
  }

  static Alert createAlert(int i) {
    return Alert(id: i, photo: photoTrash, position: const LatLng(-29.505503, -51.967846), routeId: 1, type: AlertType.TRASH, observation: "Lixo na rua, na lateral do bar");
  }

  static List<RouteApp> createManyRoute(int howMany) {
    List<RouteApp> routes = [];
    for (int i = 0; i < howMany; i++) {
      routes.add(createRoute(i));
    }
    return routes;
  }

  static RouteApp createRoute(int index) {
    return RouteApp(
        id: index,
        name: "Rota $index",
        positions: [const LatLng(-29.505232, -51.967808)],
        alerts: [createAlert(1), createAlert(2)],
        startPosition: const LatLng(-29.505503, -51.967846),
        endPosition: const LatLng(-29.505107, -51.967789)
    );
  }

  static const String photoTrash = "";

}